    total_count = 0

    # Function to check if a substring has at most k zeros or k ones
    def has_at_most_k_ones_or_zeros(substring, k):
        return substring.count('0') <= k or substring.count('1') <= k

    # Iterate over all possible substring lengths
    for length in range(1, n + 1):
        zero_count = 0
        one_count = 0

        # Initialize the first window of size 'length'
        for i in range(length):
            if s[i] == '0':
                zero_count += 1
            else:
                one_count += 1

        # Check if the initial window is valid
        if has_at_most_k_ones_or_zeros(s[:length], k):
            total_count += 1

        # Slide the window across the string
        for start in range(1, n - length + 1):
            end = start + length - 1

            # Update counts based on the character being added and removed
            if s[start - 1] == '0':
                zero_count -= 1
            else:
                one_count -= 1

            if s[end] == '0':
                zero_count += 1
            else:
                one_count += 1

            # Check if the current window is valid
            if has_at_most_k_ones_or_zeros(s[start:end+1], k):
                total_count += 1

    return total_count
