        for j in range(length):
            if s[j] == '0':
                zero_count += 1
            else:
                one_count += 1

        # If the current window is valid, add its count to total_count
        if zero_count <= k or one_count <= k:
            total_count += 1

        # Slide the window across the string
        for i in range(1, n - length + 1):
            if s[i - 1] == '0':
                zero_count -= 1
            else:
                one_count -= 1

            if s[i + length - 1] == '0':
                zero_count += 1
            else:
                one_count += 1

            # If the new window is valid, add its count to total_count
            if zero_count <= k or one_count <= k:
                total_count += 1

    return total_count
